import React from "react";
import styled from "styled-components";
import { ReactComponent as Logo } from "./assets/logo-nsure-white.svg";
import { ReactComponent as bilingIcon } from "./assets/billing.svg";
import { ReactComponent as transactionIcon } from "./assets/transaction.svg";

const SideBar = styled.div`
  width: 240px;
  height: 900px;
  margin: 0 10px 0 0;
  padding: 0 0 552px;
  background-color: rgba(1, 101, 255, 0.85);
`;

const SideBarItem = styled.div`
  width: 240px;
  height: 40px;
  margin: 0 0 7px;
  padding: 8px 86px 8px 37px;
  // opacity: 0.2;
  // background-color: #ffffff;
  // color:white;
`;

const ItemText = styled.span`
  width: 86px;
  height: 20px;
  margin: 2px 0 2px 7px;
  font-family: PingFangSC;
  font-size: 14px;
  font-weight: 500;
  font-stretch: normal;
  font-style: normal;
  line-height: 1.43;
  letter-spacing: normal;
  color: #ffffff;
`;

const Header = styled.div`
  width: 240px;
  height: 64px;
  margin: 0 0 103px;
  padding: 20px 53px 20px 70px;
  background-color: #0165ff;
`;

const NSureLogo = styled(Logo)`
  width: 117px;
  height: 24px;
  object-fit: contain;
`;

const IconContainer = styled.div`
  width: 24px;
  height: 24px;
  margin: 0 7px 0 0;
  padding: 4px;
`;

const BilingIcon = styled(bilingIcon)`
  width: 24px;
  height: 24px;
  margin: 0 22px 1px;
  object-fit: contain;
`;

const TransactionIconn = styled(transactionIcon)`
  width: 16px;
  height: 16px;
`;

const Sidebar = () => {
  return (
    <SideBar>
      <Header>
        <NSureLogo />
      </Header>
      <SideBarItem>
        <IconContainer>
          {" "}
          <TransactionIconn />
        </IconContainer>
        <ItemText>Transactions</ItemText>
      </SideBarItem>
      <SideBarItem>
        <BilingIcon />
        <ItemText>Billing </ItemText>
      </SideBarItem>
    </SideBar>
  );
};

export default Sidebar;
